import React from "react";

export default function Footer() {
  return (
    <>
      <footer className="fixed-bottom ">
        <div className="ms-4 ">
          <span className="text-muted mx-2"> EN </span>
          <span className=" mx-2"> FR </span>
          <span className=" mx-2"> AR </span>
        </div>
      </footer>
    </>
  );
}
